          'Afrika Selatan adalah sebuah negara di kawasan Afrika Selatan. Ibukota Afrika Selatan adalah Pretoria (ibu kota administratif), Cape Town (ibu kota legislatif), Bloemfontein, (ibu kota peradilan). Ini memiliki luas 1.219.912 kilometer persegi dan populasi 57.779.622. Bahasa yang digunakan termasuk Zulu, Xhosa dan Afrikaans.',
