          'Südafrika ist ein Land in der Region Südliches Afrika. Die Hauptstadt Südafrikas ist Pretoria (Verwaltungshauptstadt), Kapstadt (Legislativhauptstadt), Bloemfontein (Rechtshauptstadt). Es hat eine Fläche von 1.219.912 Quadratkilometern und eine Bevölkerung von 57.779.622. Gesprochene Sprachen sind Zulu, Xhosa und Afrikaans.',
      'ja_Jpan':
